      magnam asperiores, officia numquam nobis deleniti! Tempora esse magnam
      quam quia!
    </div>
  );
}
function App() {
  function fullName(firstName, lastName) {
    return `${firstName} ${lastName}`;
  }
  return (
    <div>
      <Feature></Feature>
      <Feature></Feature>
      <Feature></Feature>
      <h2>{fullName("Nguyễn", "Tuấn Vỹ")}</h2>
    </div>
  );
}

function Youtubeitem() {
  return (
    <div className="youtube-item">
      <img
        src="https://images.unsplash.com/photo-1657299156725-dc862fea3e11?ixlib=rb-1.2.1&ixid=MnwxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1470&q=80"
        alt=""
        className="youtube-image"
      />
      <div className="youtube-footer">
        <img
          src="https://images.unsplash.com/photo-1657299156725-dc862fea3e11?ixlib=rb-1.2.1&ixid=MnwxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1470&q=80"
          alt=""
          className="youtube-avatar"
        />
        <div className="youtube-info"></div>
      </div>
    </div>
  );
}
export default App;
